//-----------------------------------------------------------------
// Clocked Block for machine csm
//-----------------------------------------------------------------
always @(
   posedge clk
) 
begin : clocked_block_proc
   if (!rst) begin
      current_state <= ST_reset;
      csm_timer <= 8'd0;
   end
   else if (timeoutrst) begin
      current_state <= ST_reset;
      csm_timer <= 8'd0;
   end
   else if (abort) begin
      current_state <= ST_reset;
      csm_timer <= 8'd0;
   end
   else 
   begin
      current_state <= next_state;
      csm_timer <= csm_next_timer;

      // Combined Actions
      case (current_state) 
         ST_reset: begin
            can_bus_reg_cld=1'b0;
            addr_write_cld =1'h0;
            error_count_reg = 1'h0;
         end
         write_elink: begin
            addr_write_cld =5'h0;
         end
         ST_Rest_2: begin
            addr_write_cld =addr_write_cld+1'h1;
         end
         ST_Rest_4: begin
            addr_write_cld  = 5'h0;
         end
         St_wait: begin
            addr_write_cld  = 5'h0;
         end
         ST_Rest_RS_2: begin
            addr_write_cld =addr_write_cld+1'h1;
         end
         ST_Init_1: begin
            addr_write_cld =addr_write_cld+1'h1;
         end
         st_Init_2: begin
            addr_write_cld =5'h0;
         end
         ST_Rest_RS_3: begin
            addr_write_cld  = 1'b0;
         end
         ST_CountRst: begin
            can_bus_reg_cld<=1'b0;
         end
         ST_Start_Cnt: begin
            can_bus_reg_cld<=can_bus_reg_cld +1;
         end
         ST_Read_reg3: begin
            addr_write_cld =5'h3;
         end
         Start_reading: begin
